import * as React from 'react';
import { Card } from '@material-ui/core';
import { CardMedia } from '@material-ui/core';
import { Button } from '@material-ui/core';
import './Cards.css';

import arcade from '../images/arcade.png';
import calcetto from '../images/calcetto.png';
import coding from '../images/coding.png';
import furnace from '../images/furnace.png';
import meeting from '../images/meeting.png';
import party from '../images/party.png';
import pingpong from '../images/pingpong.png';


const Cards = () => {
    return (
        <>  
        <Card className="CardStyle" style={{backgroundColor:'#f8d06b'}}> <Button onClick={() => {
          console.log('clicked');}}> <CardMedia
          component="img"
          image={arcade}
          alt="arcade"
          /> </Button>
        </Card>
        <Card className="CardStyle" style={{backgroundColor:'#f89b22'}}> <Button> <CardMedia
          component="img"
          image={calcetto}
          alt="calcetto"
          /> </Button>
        </Card>
        <Card className="CardStyle" style={{backgroundColor:'#ea3940'}}> <Button> <CardMedia
          component="img"
          image={coding}
          alt="coding"
          /> </Button>
        </Card>
        <Card className="CardStyle" style={{backgroundColor:'#7cc142'}}> <Button> <CardMedia
          component="img"
          image={furnace}
          alt="furnace"
          /> </Button>
        </Card>
        <Card className="CardStyle" style={{backgroundColor:'#'}}> <Button> <CardMedia
          component="img"
          image={meeting}
          alt="meeting"
          /> </Button>
        </Card>
        <Card className="CardStyle" style={{backgroundColor:'#'}}> <Button> <CardMedia
          component="img"
          image={party}
          alt="party"
          /> </Button>
        </Card>
        <Card className="CardStyle" style={{backgroundColor:'#'}}> <Button> <CardMedia
          component="img"
          image={pingpong}
          alt="pingpong"
          /> </Button>
        </Card>
        <br/>
        <Card className="CardStyle" style={{backgroundColor:'#'}}> <Button> <CardMedia
          component="img"
          image={pingpong}
          alt="pingpong"
          /> </Button>
        </Card>
        <Card className="CardStyle" style={{backgroundColor:'#'}}> <Button> <CardMedia
          component="img"
          image={party}
          alt="party"
          /> </Button>
        </Card>
        <Card className="CardStyle" style={{backgroundColor:'#'}}> <Button> <CardMedia
          component="img"
          image={meeting}
          alt="meeting"
          /> </Button>
        </Card>
        <Card className="CardStyle" style={{backgroundColor:'#7cc142'}}> <Button> <CardMedia
          component="img"
          image={furnace}
          alt="furnace"
          /> </Button>
        </Card>
        <Card className="CardStyle" style={{backgroundColor:'#ea3940'}}> <Button> <CardMedia
          component="img"
          image={coding}
          alt="coding"
          /> </Button>
        </Card>
        <Card className="CardStyle" style={{backgroundColor:'#f89b22'}}> <Button> <CardMedia
          component="img"
          image={calcetto}
          alt="calcetto"
          /> </Button>
        </Card>
        <Card className="CardStyle" style={{backgroundColor:'#f8d06b'}}> <Button onClick={() => {
          console.log('clicked');}}> <CardMedia
          component="img"
          image={arcade}
          alt="arcade"
          flipped="false"
          /> </Button>
        </Card>
        </>
    );
}

export default Cards;
